import React from "react";
import styled from "styled-components";
import { Container } from "../../components/layout/Container";
import { FullImage } from "../../components/UI/FullImage";

import Body from "../../components/layout/Body";
import TwoColumn from "../../components/UI/TwoColumn";

import frankImage from "../../assets/images/frank.jpg";
import frank2 from "../../assets/images/frank2.jpg";
import frank3 from "../../assets/images/frank3.jpg";

const frank = () => {
  return (
    <Container space>
      <FullImage imageSrc={frankImage} />
      <Text>
        <Body>
          <Subtitle>Who is Frank?</Subtitle>
          <p>
            What differentiates Frank from our competitors is how we run the
            business, day in day out. Family owned and operated, we take pride
            in the fact that we have many long-standing members of the Frank
            team.
          </p>
        </Body>
      </Text>
      <TwoColumn title="Commitment to Quality" imageSrc={frank2}>
        <p>
          I am a window and door man. With a career that has spanned almost 50
          years in the industry, I began on the shop floor and worked my way up.
          I have learned from industry leaders and innovators, and had the good
          fortune of creating longstanding friendships with employees and
          customers. In all my years I have seen lots of change, highs and lows,
          and everything in between, and my experience has shaped my approach to
          the window business. Everyone is looking for something different at a
          great value. At FRANK, we have solutions and offer a level of
          customization unparalleled when compared to other manufacturers. What
          we do is simple -- We make windows and doors - for everyone.
        </p>
      </TwoColumn>

      <TwoColumn
        title="Placeholder copy
