          great value. At FRANK, we have solutions and offer a level of
          customization unparalleled when compared to other manufacturers. What
          we do is simple -- We make windows and doors - for everyone.
        </p>
      </TwoColumn>
    </Container>
  );
};

const Subtitle = styled.h4`
  display: grid;
`;

const Text = styled.div`
  display: grid;
  padding: 0 ${({ theme }) => theme.paddingW};
`;

export default frank;
